import React from 'react';

function ProgressBar() {
  const progressBarStyles = {
    maxWidth: '500px',
    height: '12px',
    backgroundColor: '#f1f1f1',
    borderRadius: '6px',
    margin: '10px auto',
    position: 'relative',
  };

  const progressFillStyles = {
    height: '100%',
    backgroundColor: '#4CAF50',
    borderRadius: '6px',
    position: 'absolute',
    top: '0',
    left: '0',
  };

  const progressLabelStyles = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    color: '#333',
    fontSize: '16px',
    fontWeight: 'bold',
    textTransform: 'uppercase',
  };

  return (
    <section id="skills" style={{ color: 'black' }}>
      <h1 style={{ color: '#00afb9', fontSize: '25px' }}>Skills</h1>
      <div>
        <span>HTML/CSS</span>
        <div style={progressBarStyles}>
          <div style={{ ...progressFillStyles, width: '90%', backgroundColor: '#ef476f' }}></div>
        </div>
      </div>
      <div>
        <span>JavaScript</span>
        <div style={progressBarStyles}>
          <div style={{ ...progressFillStyles, width: '80%', backgroundColor: '#ef476f' }}></div>
        </div>
      </div>
      <div>
        <span>React</span>
        <div style={progressBarStyles}>
          <div style={{ ...progressFillStyles, width: '70%', backgroundColor: '#ef476f' }}></div>
        </div>
      </div>
    </section>
  );
}

export default ProgressBar;
